        "title": "The Most Successful Scientific Theory Ever: The Standard Model",
        "description": "The Standard Model of particle physics is the most successful scientific theory of all time. It describes how everything in the universe is made of 12 different types of matter particles, interacting with three forces, all bound together by a rather special particle called the Higgs boson. It‚Äôs the pinnacle of 400 years of science and gives the correct answer to hundreds of thousands of experiments. In this explainer, Cambridge University physicist David Tong recreates the model, piece by piece, to provide some intuition for how the fundamental building blocks of our universe fit together. At the end of the video, he also points out what‚Äôs missing from the model and what work is left to do in order to complete the Theory of Everything.\n\n**Correction: At  13'50\", the photon should be included with the three fundamental forces. The animation here is incorrect, while the narration is correct.",
